import React from 'react';
import { Image, StyleSheet, Text, TouchableOpacity, View } from 'react-native';
import { Container, Texto, Img} from './style';

export default function App() {
  return (
    <Container>
      <Img source={{ uri: 'https://i.dailymail.co.uk/1s/2020/01/29/21/24053262-7944405-image-m-18_1580333930708.jpg' }} style={styles.logo} />
      <Texto>
        A imagem acima aparece por causa da tag view e image
      </Texto>

      <TouchableOpacity
        onPress={() => alert('enganei o bobo')}
        style={{ backgroundColor: 'papayawhip'}}>
        <Texto id='teste'>Aperte para ver cachorros gratis online atualizado 2022</Texto>
      </TouchableOpacity>
    </Container>
  );
}

const styles = StyleSheet.create({
  logo: {
    width: 400,
    height: 200,
    marginBottom: 20,
  },

});
